BEGIN;
create table toast_plain(
	id int PRIMARY KEY,
	text_column TEXT
);
ALTER TABLE public.toast_plain ALTER COLUMN text_column SET STORAGE PLAIN;
INSERT INTO public.toast_plain
	SELECT i,'#' || (i +1)::VARCHAR
		FROM generate_series(1, 100) AS k(i);
COMMIT;

